  function Cancelhandler () {
  props.onCancel();
  }

   function Confirmhandler () {
   props.onConfirm();
   }

   return (
       <div className="modal">
           <p>Are you sure?</p>
           <button className="btn btn--alt" onClick={props.onCancel}>Cancel</button>
           <button className="btn" onClick={Confirmhandler}>Confirm</button>
       </div>
   )
}

export default Modal;
